import React from 'react';

// Add event options
const TRACK_EVENTS = [
  '100m', '200m', '400m', '800m', '1500m', '3000m', '5000m', '10000m',
  '100mH', '110mH', '400mH', '3000mSC',
  '4x100m', '4x400m'
];

const FIELD_EVENTS = [
  'HJ', 'PV', 'LJ', 'TJ',
  'SP', 'DT', 'HT', 'JT'
];

const COMBINED_EVENTS = [
  'Heptathlon', 'Decathlon', 'Pentathlon'
];

function CalculatorForm({ 
  gender, setGender,
  season, setSeason,
  mode, setMode,
  selectedEvent, setSelectedEvent,
  result, setResult,
  windSpeed, setWindSpeed,
  onCalculate,
  points,
  isWorldRankings = false
}) {
  const handleCalculateClick = async (e) => {
    e.preventDefault(); // Prevent form submission
    if (result) {
      await onCalculate(); // Call the calculate function passed from parent
    }
  };

  return (
    <div className="calculator-form">
      <div className="gender-toggle">
        <div className="toggle-container">
          <div className={`toggle-slider ${gender === 'womens' ? 'right' : 'left'}`} />
          <div 
            className={`toggle-option ${gender === 'mens' ? 'active' : ''}`}
            onClick={() => setGender('mens')}
          >
            Men
          </div>
          <div 
            className={`toggle-option ${gender === 'womens' ? 'active' : ''}`}
            onClick={() => setGender('womens')}
          >
            Women
          </div>
        </div>
      </div>

      <div className="season-toggle">
        <div className="toggle-container">
          <div className={`toggle-slider ${season === 'indoor' ? 'right' : 'left'}`} />
          <div 
            className={`toggle-option ${season === 'outdoor' ? 'active' : ''}`}
            onClick={() => setSeason('outdoor')}
          >
            Outdoor
          </div>
          <div 
            className={`toggle-option ${season === 'indoor' ? 'active' : ''}`}
            onClick={() => setSeason('indoor')}
          >
            Indoor
          </div>
        </div>
      </div>

      <div className="mode-section">
        <label>Mode:</label>
        <div className="toggle-container">
          <div className={`toggle-slider ${mode === 'points' ? 'right' : 'left'}`} />
          <div 
            className={`toggle-option ${mode === 'result' ? 'active' : ''}`}
            onClick={() => setMode('result')}
          >
            Result → Points
          </div>
          <div 
            className={`toggle-option ${mode === 'points' ? 'active' : ''}`}
            onClick={() => setMode('points')}
          >
            Points → Result
          </div>
        </div>
      </div>

      <div className="event-section">
        <label>Event:</label>
        <select 
          value={selectedEvent} 
          onChange={(e) => setSelectedEvent(e.target.value)}
        >
          <optgroup label="Track Events">
            {TRACK_EVENTS.map(event => (
              <option key={event} value={event}>{event}</option>
            ))}
          </optgroup>
          <optgroup label="Field Events">
            {FIELD_EVENTS.map(event => (
              <option key={event} value={event}>{event}</option>
            ))}
          </optgroup>
          <optgroup label="Combined Events">
            {COMBINED_EVENTS.map(event => (
              <option key={event} value={event}>{event}</option>
            ))}
          </optgroup>
        </select>
      </div>

      <div className="result-section">
        <label>{mode === 'result' ? 'Result:' : 'Points:'}</label>
        <input
          type="number"
          value={result}
          onChange={(e) => setResult(e.target.value)}
          placeholder={mode === 'result' ? 'Enter result' : 'Enter points'}
          step="any"
        />
      </div>

      {mode === 'result' && (
        <div className="wind-section">
          <label>Wind (m/s):</label>
          <input
            type="number"
            value={windSpeed}
            onChange={(e) => setWindSpeed(e.target.value)}
            placeholder="Enter wind speed (+/-)"
            step="0.1"
          />
          <small>+ for tailwind, - for headwind</small>
        </div>
      )}

      <button 
        className="calculate-button" 
        onClick={handleCalculateClick}
        disabled={!result}
      >
        Calculate
      </button>

      {points !== null && (
        <div className="results">
          <h3>Results</h3>
          <div className="base-score">Base Score: {points} points</div>
        </div>
      )}
    </div>
  );
}

export default CalculatorForm;
